The art of Moebius - A collection of graphic works with an introduction by George Lucas

Moebius aka Jean Henri Gaston Giraud (born May 8, 1938[1]) is a French comics artist. Giraud has earned worldwide fame, not only under his own name but also under the pseudonym Moebius, and to a lesser extent Gir, the latter appearing mostly in the form of a boxed signature at the bottom of the artist's paintings, for instance the volumes' covers.  &lt;a href=&quot;
